import Link from 'next/link';

const StyledHeader = styled.div`
	height: 75px;
	margin: 0px;
	padding: 0px 82px; 
	background-color: ${props => props.theme.primary};
	display: flex;
	flex-direction: row;
	justify-content: space-between;
	align-items: center;
`;

const Header = () => (
	<StyledHeader>
		<img src="/dog-icon.png"></img> {/* A JSX comment */}
		<nav>
			<ul>
				<li>
					<Link href="/">
						<a>Find a Pup</a>
					</Link>
				</li>
				<li>
					<Link href="/about">
						<a>About</a>
					</Link>
				</li>
			</ul>
		</nav>
	</StyledHeader>
);

export default Header;

